import React from 'react';
import './App.css'
import Calendar from './components/Calendar/Calendar.js';
import { Provider } from 'react-redux';
import store from './store/store';

function App() {
  return (
    <div>
      <Provider store={store}>
      <Calendar/>
      </Provider>

    </div>
  )
}

export default App
